import React from "react";
import "../../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { NavLink } from "react-router-dom";
import { Button } from "./Button";
import styled from "styled-components";
import { Formik, useFormik ,Form ,Field} from "formik";
import { signUpSchema } from "../../../Schemas/Yup_Contact";
// import * as yup from 'yup';


const Contact = () => {
  const initialValues = {
    name: "",
    email: "",
    contact: "",
    budget: "",
    country: "",
    id: "",
    desc: "",
  };
//   const signUpSchema = yup.object()({
//     name: yup.string().min(4).max(25).required("Please enter your Name"),
//     email: yup.string().email().required("please enter your Email"),
//     contact: yup.string().integer().required("Please enter your Contact Number"),
//     budget: yup.string().required("Please enter your Budget"),
//     country: yup.string().required("Please enter your Country"),
//     id: yup.string().positive().integer().min(1).max(25).integer().required("Please enter your Skype ID/Whatsapp No"),
//     desc: yup.string().required("Please enter your Description"),
// });
  const { values, errors, handleBlur, handleChange, handleSubmit }  = useFormik({

    initialValues,
    validationSchema: signUpSchema,
    onSubmit: (values) => {
      console.log(values);
    },
  });

  return (
    <>
      <Wrapper>
        <div className="container" style={{ background: "#101434" }}>
          <Formik>
          <Form className="row g-3 needs-validation" onSubmit={handleSubmit}>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom01" className="form-label">
                  Name
                </label>
                <Field
                  type="name"
                  className="form-control"
                  id="validationCustom01"
                  autocomplete="off"
                  name="name"
                  value={values.name}
                  onChange={handleChange}
                />

              </div>
            </div>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom02" className="form-label">
                  Email Address
                </label>
                <Field
                  type="email"
                  className="form-control"
                  id="validationCustom02"
                  autocomplete="off"
                  name="email"
                  value={values.email}
                  onChange={handleChange}
                  onBlur={handleBlur}
                />

              </div>
            </div>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom01" className="form-label">
                  Contact Number
                </label>
                <Field
                  type="number"
                  className="form-control"
                  id="validationCustom01"
                  autocomplete="off"
                  name="contact"
                  value={values.contact}
                  onChange={handleChange}
                />

              </div>
            </div>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom02" className="form-label">
                  Your Budget
                </label>
                <Field
                  type="text"
                  className="form-control"
                  id="validationCustom02"
                  autocomplete="off"
                  name="budget"
                  value={values.budget}
                  onChange={handleChange}
                />

              </div>
            </div>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom02" className="form-label">
                  Country
                </label>
                <Field
                  type="text"
                  className="form-control"
                  id="validationCustom02"
                  autocomplete="off"
                  name="country"
                  value={values.country}
                  onChange={handleChange}
                />

              </div>
            </div>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom02" className="form-label">
                  (Skype ID/Whatsapp No)
                </label>
                <Field
                  type="number"
                  className="form-control"
                  id="validationCustom02"
                  autocomplete="off"
                  name="id"
                  value={values.id}
                  onChange={handleChange}
                />

              </div>
            </div>
            <div className="col-md-12">
              <div className="form-outline">
                <label for="validationCustom02" className="form-label">
                  Project Description
                </label>
                <textarea
                  type="text"
                  autocomplete="off"
                  class="form-control"
                  rows="5"
                  name="desc"
                  id="desc"
                  value={values.desc}
                  onChange={handleChange}
                ></textarea>

              </div>
            </div>
            <div className="col-12">
              <NavLink to="/">
                <Button
                  type="submit"
                  className="submit_btn"
                >
                  Submit
                </Button>
              </NavLink>
            </div>
          </Form>
          </Formik>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.div`
  padding: 5rem 0;
  color: ${({ theme }) => theme.colors.color_white};
  font-size: 1.7rem;
  .container {
    padding: 4rem;
  }
  input ,
  textarea{
    width: 100%;
    height: 5rem;

    font-size:1.5rem;
}

  .submit_btn {
    background: ${({ theme }) => theme.colors.btn_color};
    display: block;
    margin: auto;
    margin-top:2rem;
    padding:1rem 6rem;
    color:${({ theme }) => theme.colors.heading};
    font-weight:600;
    font-size:1.5rem;
  }
`;
export default Contact;
